          <b-nav-form>
            <el-dropdown>
              <el-button class="el-dropdown-link" style="background-color: cadetblue;border: #14798d;margin-right: 10px">
                二维码<i class="el-icon-arrow-down el-icon--right"></i>
              </el-button>
              <el-dropdown-menu slot="dropdown">
