                  <img :src=ImageQc alt="">
<!--                  <img src="" alt="">-->
                </div>
              </el-dropdown-menu>
            </el-dropdown>
<!--            <el-button style="background-color: cadetblue;border: #14798d;margin-right: 10px" @click=CreateQc>-->
<!--              二维码-->
<!--              <i class="el-icon-picture el-icon&#45;&#45;right">-->
<!--              </i>-->
<!--            </el-button>-->
          </b-nav-form>
          <b-nav-form>
            <el-button type="info" icon="el-icon-message" circle
                       style="background-color: #14798d;border: #14798d;margin-right: 10px"
                       @click=vmessage
            ></el-button>
<!--            <el-dialog title="二维码" :visible.sync="QcdialogTableVisible">-->

<!--            </el-dialog>-->
          </b-nav-form>
          <b-nav-item>
            <locale-changer/>
