    <el-dialog title="消息列表" :visible.sync="dialogTableVisible">
      <el-table :data="gridData">
        <el-table-column property="date" label="日期" width="150"></el-table-column>
        <el-table-column property="auname" label="请求人" width="200"></el-table-column>
        <el-table-column property="audescribe" label="请求信息" width="300"></el-table-column>
        <el-table-column>
          <template #default="scope">
            <el-button type="primary" @click=agree(scope.row)>同意</el-button>
            <el-button type="danger" @click=disagree(scope.row)>拒绝</el-button>
          </template>
        </el-table-column>
      </el-table>
