<script>
import localeChanger from './form/localeChanger'
import request from "@/utils/request";
import axios from "axios";
// import {mapGetters} from "vuex";
// import form from "@/data/form";

export default {
  name: 'appHeader',
  components: {localeChanger},
  props: ['user'],
  data() {
    return {
      ImageQc: "",
      agrform: {
        user_id: "",
        auname: "",
        agree: "",
      },
      dialogTableVisible: false,
      QcdialogTableVisible: true,
      // gridData: [{
      //   auname: "",
      //   audescribe: "",
      // }, {
      //   auname: "",
      //   audescribe: "",
      // }, {
      //   auname: "",
      //   audescribe: "",
      // }, {
      //   auname: "",
      //   audescribe: "",
      // }, {
      //   auname: "",
      //   audescribe: "",
      // }]
      gridData: [],
    }
  },
  created() {
    this.CreateQc();
  },
  methods: {
    vmessage() {
      this.dialogTableVisible = true;
      let userJson = sessionStorage.getItem("user");
      if (!userJson) {
        return
      }
      let userId = JSON.parse(userJson).id
      var that = this;
      request.get("/auda?id=" + userId).then(res => {
        console.log(res);
        for (var i = 0; i < res.data.length; i++) {
          // that.gridData.length = res.data.length;
          // that.gridData[i].auname = res.data[i].auname;
          that.gridData = res.data.map(res => {
            return {
              ...res,
            }
          })
        }
      })
    },
    agree(row) {
      this.form = JSON.parse(JSON.stringify(row))
      this.agrform.auname = this.form.auname;
      this.agrform.agree = 1;
      console.log(this.agrform);
      this.reqagr();
    },
    disagree(row) {
      this.form = JSON.parse(JSON.stringify(row))
      console.log(this.form);
      this.agrform.auname = this.form.auname;
      this.agrform.agree = 0;
      this.reqagr();
    },
    reqagr() {
      // if (this.form.id) {
      let user = JSON.parse(sessionStorage.getItem("user"))
      this.agrform.user_id = user.id
      var that = this;
      request.put("/auda/agr", this.agrform).then(res => {
        console.log(res);
        if (that.agrform.agree == "1") {
          this.$message.success('已同意')
        }
        if (that.agrform.agree == "0") {
          this.$message.error('已拒绝')
        }
      })
      // }
    },
    CreateQc() {
      // var that=this;
      axios.request({
        url:"/api/createQrCode",  //这里是你的请求url
        responseType:'blob',  //这里最重要,不要去掉
        method:'get',   //请求方式,看后台的需求,可能是get,post等方式
        // headers:{ Authorization: 'Bearer' + getToken() }
      }).then(res => {
        const {data, headers}=res
        const blob=new Blob([data],{type:headers['content-type']})
        // this.ImageQc=window.URL.createObjectURL(blob);
        this.blobToBase64(blob).then(res =>{
          this.ImageQc=res
          // console.log('base64', res)
        })
        // let blob = new Blob([res],{type: "image/png"});
        // let url = window.URL.createObjectURL(res.data);
        // this.ImageQc=url;
        // that.ImageQc="http://localhost:9876/api/createQrCode"
        // console.log(this.ImageQc);
        // this.ImageQc="data:application/octet-stream;base64,"
        // var that = this;
      // request.get("/createQrCode").then(res => {
      //   // let blob = new Blob([res], {type: "image/png"});
      //   // let url = window.URL.createObjectURL(blob);
      //   // that.ImageQc = url;
      //   // console.log(that.ImageQc);
      //   that.ImageQc = window.URL.createObjectURL(res)
      })
    },
    blobToBase64(blob){
      return new Promise((resolve ,reject)=>{
        const fileReader =new  FileReader();
        fileReader.onload = (e) =>{
          resolve(e.target.result);
        };
        fileReader.readAsDataURL(blob);
        fileReader.onerror = () =>{
          reject(new Error('文件流异常'))
        }
      })
    }
  }
}
</script>
